Edit: Swapped 2 DD crow with 2 book of moon

Recently Konami released Fish Sonar, a spell card that allows you to search all monsters from the Umi archtype... all except Legendary Fisherman III :) so to my unhappiness this one card can't save Fisherman decks from being bad and inconsistent, but at least they are a lit more playable now.

Shark engine can be used to either XZY or summon your Legendary Fisherman.

&nbsp;

Um Deck de Bruxas, As Witchcrafters (Eu Deveria Ter Esperado o Halloween Pra postar)

Esse Deck contem 49 Cards (24 Monster | 21 Spell | 4 Trap)

&nbsp;

Go for a massive board flood.

Zeus here to get through big boards (which the deck may struggle usualy)

&nbsp;

This is my favorite deck.

&nbsp;

&nbsp;

I am not sure if ZS Utopic sage, utopia dragner, leo utopia ray or utopic astral force were released into duel links

&nbsp;

there is a really good combo for this deck summon utopia double use it's effect to summon utopia dragner, detach two of dragner's materials summon utopic dragon, activate dragon's effect to summon number 60 use the draw 2 effect use zexal force summon leo utopia ray using numbe 60.

&nbsp;

it is easiest to summon stuff using onomatapara. use it to get utopic onomatapoeia and dododo dwarf gogogo glove. Summon onomatapoeia and use it to summon dododo dwarf

Deck creado por: Darklab

